import React, { Component } from 'react';
import './App.css';

class LandingPage extends Component {
  render() {
    return (
      <div>
        <div id="home" className="home">
          <div className="text-vcenter">
            {/*<h1>Hello World</h1>*/}
            {/*<h3>This is bootstrap-based layout</h3>*/}
            {/*<a href="#about" className="btn btn-default btn-lg">Continue</a>*/}
          </div>
        </div>
        <div className="container">
          <div className="text-center">
            <span className="highlights glacial-indifference">Our </span><span className="highlights kollektif">Collection</span>
          </div>
        </div>
        <section className="section">
          <div className="container">
            <div id="carousel-demo" className="carousel">
              <div className="item-1">
              </div>
              <div className="item-2">
              </div>
              <div className="item-3">
              </div>
            </div>
          </div>
        </section>
      </div>
    );
  }
}

export default LandingPage;
